import React from 'react';
import './App.css';

function App() {
  return (
    <div style={style.wrapper}>
      <header>
        <label style={style.appTitle}>VIMATION</label>
      </header>

    </div>
  );
}

export default App;


const style = {
  wrapper : {
    backgroundColor : 'black',
    color: 'white',
    height: '100vh',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  appTitle : {
    fontSize : '2.2em',
    color : 'white'
  }
}
